import Box from "@mui/material/Box";
import { useState } from "react";
const RoundBox = ({ side }) => {
  const [roundSide, roundSideChange] = useState("right");
  return roundSide === "left" ? (
    <Box
      className="left-box"
      sx={{
        width: "auto",
        maxWidth: "600px",
        height: "100px",
        alignItems: "center",
        backgroundColor: "white",
        margin: "left",
      }}
    >
      hello
    </Box>
  ) : (
    <Box
      className="right-box"
      sx={{
        width: "auto",
        maxWidth: "600px",
        height: "100px",
        alignItems: "center",
        backgroundColor: "white",
        margin: "left",
      }}
    >
      hello
    </Box>
  );
};

export default RoundBox;
